import React from 'react'
import Panel from '../components/Panel'
import LoggedNavBar from '../components/LoggedNavBar'

const LoggedPage = () => {
  return (
    <div className='container'>
      <LoggedNavBar />
      <Panel />
    </div>
  )
}

export default LoggedPage
